import { css, LitElement } from 'lit';
export default class IgcSliderLabelComponent extends LitElement {
    createRenderRoot() {
        return this;
    }
}
IgcSliderLabelComponent.styles = css `
    :host {
      display: none;
    }
  `;
IgcSliderLabelComponent.tagName = 'igc-slider-label';
